var TLDl = null;
function initialize() {

    if(TLDl)
        return TLDl;

    TLDl = _.orderBy(TLDsource, 'length');
    _.reverse(TLDl);
    debug("First longest TLD [%s] last shortest [%s]",
        TLDl[0], TLDl[TLDl.length - 1]);
};

function attribution(data) {
    return _.extend(data, splitCName(data.url));
}

/* attribution extend, but splitCName clean url and do:
 * .tld, .domain, .domaindottld .subdomain */
function splitCName(url) {

    initialize();

    var cu = urlutils.urlToDomain(url);
    var tld = _.find(TLDl, function(off) {
        return _.endsWith(cu, off);
    });

    /* this is a wildcard in Company mapping */
    if(!tld && _.endsWith(cu, '.')) {
        debug("Special: managing |%s| as a wildcard domain", cu);
        tld = "";
    }

    var analyzable = _.compact(_.reverse(cu.substr(0, _.size(cu) - _.size(tld)).split('.')));
    /* remove TLD, split by '.', reverse. the first is domain, if something remain is subdomain */

    var domain = _.first(analyzable);

    var ifSubdomain = _.reverse(_.tail(analyzable));
    if(_.size(ifSubdomain) > 1) {
        var subdomain = ifSubdomain.join('.');
    } else if (_.size(ifSubdomain) == 1) {
        var subdomain = _.first(ifSubdomain);
    } else {
        var subdomain = "";
    }

    return {
        tld: tld, 
        domain: domain,
        domaindottld: domain + '.' + tld,
        subdomain: subdomain
    };
}

module.exports = {
	attribution: attribution,
    splitCName: splitCName
};
